description:
Автомобиль был приобретён у официального дилера в мае 2008 г. Три собственника по ПТС (оригинал). В хорошем внешнем и техническом состоянии.
Автомобиль прошел комплексную проверку по базам ГИБДД на предмет розыска и угона, юридически чист.

Эксплуатационные показатели
Максимальная скорость, км/ч 200 Разгон до 100 км/ч, с 10.6
Расход топлива, л город/трасса 7.3/5.1
Марка топлива ДТ
Двигатель
Тип двигателя дизель
Размеры, мм
Длина 4700
Ширина 1760
Высота 1525
Колёсная база 2700
Ширина передней колеи 1505
Ширина задней колеи 1500
Размер колёс 205/55/R16
Объём и масса
Объем багажника мин/макс, л 520/1500
Объём топливного бака, л 60

3 НАШИХ ПРАВИЛА:
 Мы не «скручиваем» пробег;
 Мы не прячем крашеные элементы (проговариваем о них сразу);
 Мы даем честный отчет по ТЕХсостоянию автомобилей (результат диагностики);

НАШИ УСЛУГИ:
 Покупка и продажа автомобилей с пробегом;
 Обмен автомобилей на новые автомобили марки MAZDA;
 Обмен автомобилей на другие автомобили с пробегом;
 Комиссионная продажа автомобилей;
 Срочный выкуп автомобилей (в т. ч. с банковским обременением);
 Диагностика автомобилей с пробегом;
 Проверка лакокрасочного покрытия автомобилей;
 Автокредитование и автострахование " на месте".

НАШИ ПРЕИМУЩЕСТВА:
 Гарантия объективной оценки Вашего автомобиля;
 Гарантия юридической чистоты автомобилей;
 Полная предпродажная подготовка автомобиля

Осуществить осмотр автомобиля и пройти тест- драйв можно по адресу автосалона, в любое удобное для Вас время с 9:00 утра до 20:00 вечера
